export default interface PropTypes {
  /**
   * The type of the form, if no type is set then 'default' will be used
   */
  type?: string
  /**
   * Header Text
   */
  headerText: string
  /**
   * ClassName of form
   */
  formClassName?: string
  /**
   * ClassName of form header
   */
  formHeaderClassName?: string
}
